import React,{Component} from "react";

const data=(props)=>{
return(
    <div>
        <diV>country: {props.country}</diV>
        <diV>city: {props.city}</diV>
        <diV>tempreature: {props.temp}</diV>
        <diV>humidity: {props.humidity}</diV>
        <diV>description: {props.description}</diV>
        <diV>{props.error}</diV>
    </div>
)
}
export default data
